CREATE TABLE Departamentos (
    Id TEXT(2) NOT NULL, -- Código único del departamento
    Nombre TEXT(45) NOT NULL, -- Nombre del departamento
    PRIMARY KEY (Id) -- Definir Id como clave primaria
);



CREATE TABLE Distritos (
    Id TEXT(6) NOT NULL, -- Código único del distrito
    Nombre TEXT(45), -- Nombre del distrito
    ProvinciaId TEXT(4), -- Código de la provincia asociada
    DepartamentoId TEXT(2), -- Código del departamento asociado
    PRIMARY KEY (Id) -- Definir Id como clave primaria
);



