CREATE TABLE Provincias (
    Id TEXT(4) NOT NULL, -- Código único de la provincia
    Nombre TEXT(45), -- Nombre de la provincia
    DepartamentoId TEXT(2), -- Código del departamento asociado
    PRIMARY KEY (Id)
);


